import React from "react";

const FaceRecognition = ({ ImageUrl, box }) => {
  return (
    <div className="center ma3">
      <img
        id="inputimage"
        src={ImageUrl}
        alt="facerecognition"
        width="500px"
        height="auto"
      />
    </div>
  );
};

export default FaceRecognition;
